  false,\n\t\"url\": null,\n\t\"notes\": \"On Tuesday April 7 and again on April 23,
  a Land Use Specialist visited the Valentine National Wildlife Refuge to review grassland
  management on the refuge. Concern was expressed by Rancher Bryon Eatinger, President,
  Nebraska Cattlemen, at the 12 February Nebraska Sand Hills Task Group meeting, that
  grassland management on the Valentine Refuge was deplorable. After viewing several
  units of the Refuge it appears that only part of Mr. Eatingers' concerns are valid.\",\n\t\"license_title\":
